def StrDec(x):
  for n in range(10**5):
    count = 0
    i = 0
    if len(str(2**n)) == x and x == 1:
      return n
    while i < len(str(2**n))-1:
      if int(str(2**n)[i]) == int(str(2**n)[i+1])-1:
        count += 1
        i += 1
      else:
        if count == x-1:
          return n
        else:
          count = 0
          i += 1
    if count == x-1:
      return n
